-- THIS SQL FILE CONTAINS ALL RELEVANT DATABASE STEPS IN SQL, WHICH ARE REQUIRED TO SETUP THE DASHBOARD
-- THE DASHBOARD SHOWS THE SPATIO-TEMPORAL MAPPING ACITIVITIES WITHIN THE COLOURING CITIES INSTANCE

-- THIS FILE IS CUSTOMIZED FOR DRESDEN, GERMANY. PLEASE REPLACE SOME DATA (E.G. GEOMETRIES OF CITY DISTICTS) WITH THE PROPER DATASET FOR YOUR CHOSEN CITY

BEGIN;
CREATE TABLE city_districts (
    city_district_id SERIAL PRIMARY KEY,
    name VARCHAR,
    geometry_asgeojson JSON
);
SELECT AddGeometryColumn('public','city_districts','geometry',4326,'POLYGON',2);
-- kann in QGIS erstellt werden (geojson importieren -> Layer exportieren -> PostgisSQL-Dump)
CREATE INDEX "city_districts_geometry_geom_idx" ON "public"."city_districts" USING GIST ("geometry");

-- erstellt zu jeder geometry eine version in geojson-format
UPDATE city_districts SET geometry_AsGeoJSON = ST_AsGeoJSON(cd.geometry)::JSON FROM city_districts cd;
COMMIT;